import { useDispatch } from "react-redux"
import { filterPokemons } from "../../Redux/Actions/action";

const FilterPokemon = () => {

    const dispatch = useDispatch();

    const filterHandler = (event) => {
        const AscDesc = event.target.name
        dispatch(filterPokemons(AscDesc))
    }



    return (
        <div>
            <div><button>refresh</button></div>

            <div>
                <button name="Ascendente" onClick={filterHandler}>A-Z</button>
                <button name="Descendente" onClick={filterHandler}>Z-A</button>
            </div>

        </div>
    )

}

export default FilterPokemon
